package com.alexbao.leetcode5;

import java.util.*;

public class MinimumDeletionsToMakeFrequenciesUnique {
    public int minDeletions(String s) {
        HashMap<Character, Integer> map = new HashMap<>();
        ArrayList<Integer> list = new ArrayList<>();
        int res = 0;
        for (int i=0; i<s.length(); i++) {
            map.put(s.charAt(i), map.getOrDefault(s.charAt(i), 0) + 1);
        }
        for (Map.Entry<Character,Integer> entry : map.entrySet()) {
            list.add(entry.getValue());
        }

        Integer[] frequencies = list.toArray(new Integer[0]);
        Arrays.sort(frequencies, Collections.reverseOrder());

        for (int i=1; i<frequencies.length; i++) {
            while (frequencies[i] >= frequencies[i-1] && frequencies[i] > 0) {
                frequencies[i] --;
                res ++;
            }
        }
        return res;
    }

    public static void main(String[] args) {
        MinimumDeletionsToMakeFrequenciesUnique app = new MinimumDeletionsToMakeFrequenciesUnique();
        String s = "";
        System.out.println(app.minDeletions(s));
    }
}
